import React from 'react';

function Navbar({ onLogout }) {
    return (
        <nav style={{ display: 'flex', justifyContent: 'space-between', padding: '10px', backgroundColor: '#ccc' }}>
            <div>
                <img src="profile-pic-url" alt="Profile" style={{ width: '40px', borderRadius: '50%' }} />
            </div>
            <button onClick={onLogout}>Wyloguj</button>
        </nav>
    );
}

export default Navbar;
